import Header from "../components/Header";
import Sidebar from "../components/Sidebar";
import styled from 'styled-components';

const Index = () => (
    <div>
        <Header />
        <div className="app__body">
            <Sidebar />
            {/* Sidebar */}
        </div>
        <style jsx global>{`
          html,
          body {
            padding: 0;
            margin: 0;
            font-family: Lobster;
          }

          * {
            box-sizing: border-box;
          }
        `}</style>
    </div>
)

export default Index;
